import React from "react";
import "./Title.css"
import $ from "jquery";



const Title = () => {

  let i = 0;
  let title = 'Brian Todd';
  const speed = 500;

  let typeWriter = () => {
    if(i < title.length){
      document.getElementById("title").innerHTML += title.charAt(i);
      i++;
      setTimeout(typeWriter, speed);
    }
  }

  $(document).ready(function(){
    typeWriter();
  })

  return (
    <div id="title">
    </div>
  )

}

export default Title;
